function spliText(text) {
  const words = text.split(/\s+/);
  const size = 140;
  const maxChunksSize = 9999;
  const chunks = [];
  const possiblePages = Math.ceil(text.length / size).toString();

  if (text.length <= 140) {
    console.log(`${text} - ${text.length}`);
    return text;
  }

  words.reduce((chuckStr, word, i, arr) => {
    const pageIndex = ' ' + (chunks.length + 1) + '/';
    console.log(1,word, (chuckStr.length + word.length + pageIndex.length + possiblePages.length) + 1 > size);
    console.log(2, word, i === arr.length - 1);
    if ((chuckStr.length + word.length + pageIndex.length + possiblePages.length) + 1 > size) {
      console.log('push', chuckStr);
      chunks.push(chuckStr + pageIndex);
      chuckStr = word;
    }else  if (i === arr.length - 1) {
      chunks.push(chuckStr + " " + word + pageIndex);
    }else {
      chuckStr += " " + word;
    }
    
    return chuckStr;
  }, '');


  if (chunks.length > maxChunksSize) {
    throw new Error(`Text is too long, chunks length is ${chunks.length}`);
  }

  return chunks.map(chunk => {
    const str = chunk.trim() + chunks.length.toString();

    if (str.length > 140) {
      console.log(`${str} - ${str.length}`);
      throw new Error(`${str} - ${str.length}`);
    }

    console.log(`${str} - ${str.length}`);

    return str;
  })
}

